import { PortfolioProfile } from './portfolio-profile.model';
export class PortfolioProject {
  constructor(partial) {
    Object.assign(this, partial);
  }
  deserialize(input) {
    Object.assign(this, input);
    this.profiles = input.profiles.map(p => new PortfolioProfile({
      ...p
    }).deserialize(p));
    return this;
  }
}
